const store = createStore(root_reducer, applyMiddleware(myMiddleWare,thunk));

function App() {
  return (
    <Provider store={store}>
    <div className="App">
      <header className="App-header">
        <Counter/>
      </header>
    </div>
    </Provider>
  );
}

export default App;
